import React,{createRef} from 'react';
import App from './App';
const Search=props=>{
    let nameRef=createRef();
    /*const put=()=>{
        let name=nameRef.current.value;
        props.add(name);

    }*/
    const post=()=>{
        let name=nameRef.current.value;
        
    }
    return(
        <div id="search">
            <input type="search" ref={nameRef}></input>
            <button onClick={post}>post</button>
            <App place={name} />
            
            
        </div>
    )
}
export default Search;
